import React, { useEffect, useState } from 'react';

const DivingElements = () => {
  const [showMessage, setShowMessage] = useState(false);
  const [treasureMessage, setTreasureMessage] = useState('');

  const diving_quotes = [
    "Diving into the depths of data like exploring ocean trenches! üåä",
    "Just like diving, machine learning requires careful preparation and bold exploration! ü§ø",
    "The deeper you dive, the more treasures you discover - same with math! üíé",
    "75+ dives and counting... just like my machine learning models! üê†",
    "Emergency First Responder certified - ready for any coding emergency! üö®",
    "5 PADI specializations unlocked, infinity more ML algorithms to master! üèÜ"
  ];

  const handleDivingMaskClick = () => {
    setShowMessage(true);
    setTimeout(() => setShowMessage(false), 3000);
  };

  const handleTreasureClick = () => {
    const randomQuote = diving_quotes[Math.floor(Math.random() * diving_quotes.length)];
    setTreasureMessage(randomQuote);

    // Create temporary achievement notification
    const achievement = document.createElement('div');
    achievement.innerHTML = `
      <div style="
        position: fixed;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
        color: white;
        padding: 20px;
        border-radius: 15px;
        box-shadow: 0 10px 30px rgba(0,0,0,0.3);
        z-index: 10000;
        text-align: center;
        max-width: 400px;
        animation: achievementPop 0.5s ease-out;
      ">
        <div style="font-size: 24px; margin-bottom: 10px;">üèÜ Achievement Unlocked! üèÜ</div>
        <div style="font-size: 16px;">${randomQuote}</div>
      </div>
    `;

    document.body.appendChild(achievement);

    setTimeout(() => {
      if (achievement.parentNode) {
        achievement.parentNode.removeChild(achievement);
      }
    }, 4000);
  };

  const createBubbles = () => {
    const bubbleContainer = document.createElement('div');
    for (let i = 0; i < 6; i++) {
      const bubble = document.createElement('div');
      bubble.className = 'bubble';
      bubble.style.left = `${Math.random() * 100}%`;
      bubble.style.width = `${15 + Math.random() * 15}px`;
      bubble.style.height = bubble.style.width;
      bubble.style.animationDelay = `${Math.random() * 6}s`;
      bubble.style.animationDuration = `${4 + Math.random() * 4}s`;
      bubbleContainer.appendChild(bubble);
    }
    return bubbleContainer;
  };

  useEffect(() => {
    // Add CSS for achievement animation
    const style = document.createElement('style');
    style.textContent = `
      @keyframes achievementPop {
        0% { transform: translate(-50%, -50%) scale(0.5); opacity: 0; }
        50% { transform: translate(-50%, -50%) scale(1.1); }
        100% { transform: translate(-50%, -50%) scale(1); opacity: 1; }
      }
    `;
    document.head.appendChild(style);

    // Create continuous bubble generation
    const bubbleInterval = setInterval(() => {
      const bubbleContainer = createBubbles();
      document.body.appendChild(bubbleContainer);

      setTimeout(() => {
        if (bubbleContainer.parentNode) {
          bubbleContainer.parentNode.removeChild(bubbleContainer);
        }
      }, 8000);
    }, 2000);

    return () => {
      clearInterval(bubbleInterval);
      if (style.parentNode) {
        style.parentNode.removeChild(style);
      }
    };
  }, []);

  return (
    <>
      {/* Depth Effect Overlay */}
      <div className="depth-effect"></div>

      {/* Diving Mask Easter Egg */}
      <div 
        className="diving-mask" 
        onClick={handleDivingMaskClick}
        title="Click me! I'm a certified dive master! ü§ø"
      ></div>

      {/* Swimming Fish */}
      <div className="fish fish-1">üê†</div>
      <div className="fish fish-2">üê°</div>
      <div className="fish fish-3">ü¶à</div>

      {/* Coral Reef */}
      <div className="coral coral-1">ü™∏</div>
      <div className="coral coral-2">üåø</div>
      <div className="coral coral-3">ü™∏</div>

      {/* Treasure Chest Easter Egg */}
      <div 
        className="treasure-chest" 
        onClick={handleTreasureClick}
        title="Click for diving wisdom! üí∞"
      >
        üì¶
      </div>

      {/* Diving Message Popup */}
      {showMessage && (
        <div style={{
          position: 'fixed',
          top: '100px',
          right: '20px',
          background: 'rgba(0, 191, 255, 0.9)',
          color: 'white',
          padding: '15px',
          borderRadius: '10px',
          zIndex: 1002,
          maxWidth: '300px',
          animation: 'fadeIn 0.5s ease-out'
        }}>
          ü§ø Fun Fact: I'm PADI Divemaster certified with 75+ dives and 5 specializations! 
          From Emergency First Responder to exploring underwater worlds! üåä
        </div>
      )}

      {/* Floating Diving Stats */}
      <div style={{
        position: 'fixed',
        bottom: '80px',
        left: '20px',
        background: 'rgba(0, 191, 255, 0.1)',
        backdropFilter: 'blur(10px)',
        border: '1px solid rgba(0, 191, 255, 0.3)',
        borderRadius: '15px',
        padding: '10px 15px',
        color: '#333',
        fontSize: '12px',
        zIndex: 1000,
        animation: 'breathe 3s ease-in-out infinite'
      }}>
        üèÜ Dive Stats: 75+ Dives | 5 Specializations | Emergency First Responder
      </div>
    </>
  );
};

export default DivingElements;
